import React from 'react'
import { View, Text } from 'react-native'
import requestStore from '../../stores/requestStore';
import RequestItem from './RequestItem'

const RequestList = ({navigation}) => {

    const requestList = requestStore.request.map((request) => (
        <RequestItem request={request} navigation={navigation} key={trip._id} />
    ))



    return (
        <View>
            <Text>{requestList}</Text>
        </View>
    )
}

export default observer(RequestList);
